('483', 'Does the process define actions to take when dealing with suppliers that do not meet the requirements??', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('484', 'Is there a method to assure that the suppliers and their sub-tire suppliers are using approved special process sources? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('485', 'Is there a process of suppliers performance assessment? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('486', 'Are records of the performance assessments available for review? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('487', 'Is there an up-to-date list of certified suppliers (ASL)? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('488', 'Does the function that has the responsibility for approving supplier quality systems also have the authority to disapprove those suppliers? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('489', 'Are docs/drawings (specs and quality requirements) attached to each order? /', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('490', 'May the customer/representative of the customer perform inspection at the suppliers (and sub-tiers) premises?  /', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('491', 'Do purchase orders to your subcontractors define all processing and testing requirements? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('492', 'Are suppliers required to submit objective evidence of the quality of the product (e.g., COC, test reports, etc)COC', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('493', 'Is there an incoming inspection activity to review the required documentation or inspect the product upon receipt? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('494', 'Is there a program whereby verification of the product is delegated to the supplier? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('495', 'Is there a mechanism for service to delivered products? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('496', 'Are process controls and control plans in place where key characteristics have been identified? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('497', 'Are the latest possible in-process verification points been identified? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('498', 'Are variable measurements taken, particularly for key characteristics?  ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('499', 'Does production documentation contain the following: A. drawings, parts list, process flow charts, etc. B. A list of specific or non-specific tools and numerical control machines programs and instructions? A.B. ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('500', 'Are the persons authorized to approve changes to production processes identified?  ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('501', 'Does the supplier identify and obtain acceptance of changes that require customer approval?  ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('502', 'Are changes that affect processes, production equipment, tools and programs documented? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('503', 'Are the changes to production processes assessed to confirm that the desired effect has been achieved without adversely effecting product quality?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '3'),
('504', 'Are production equipment, tools and programs validated prior to use? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '3'),
('505', 'Are there procedures requiring the production equipment, tools and programs to be inspected periodically? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '3'),
('506', 'Are First Article inspections completed prior to production to validate the design data/specification?  /', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('507', 'Is there a configuration management system to identify any differences between the actual configuration and the agreed configuration? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('508', 'Is there a process for controlling acceptance authority media, e.g., stamps, electronic signatures, etc.? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('509', 'Is there a unique identification for each product unit (catalog number/serial number)? /', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('510', 'Is there a Traceability report for the items in each product unit (As Planned/As Build)? /', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('511', 'Are there procedure for handling customer property? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '3'),
('512', 'Is there an up-to-date list of customer property? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '3'),
('513', 'Is the entrance/exit from storage areas controlled? /', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '3'),
('514', 'Is the packaging done in accordance to defined requirements/packaging specs? /', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('515', 'Are delivered products accompanied by the docs required by customer? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('516', 'Is the calibration method compliant with ISO-10012? ISO-10012', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('517', 'Are there instructions for calibration/maintenance for each type of M&TE tool?  /MTE', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4');
INSERT INTO `mc_master (1)` (`A`, `B`, `C`, `D`, `E`, `F`, `G`, `H`, `I`, `J`, `K`, `L`) VALUES
('518', 'Is there an up-to-date list of M & TE tools and their calibration history?  TE', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '3'),
('519', 'Is there a periodical calibration plan and is it implemented (recall)? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '3'),
('520', 'Is an up-to-date calibration tag attached to each M&TE tool?  TE', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('521', 'Is there a plan for conducting internal quality audits and is it implemented? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('522', 'Is an audit report submitted for each audit, including required corrective actions? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('523', 'Is there follow-up on open corrective actions?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('524', 'Is there a process for monitoring and controlling identified key characteristics?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('525', 'Is there a process for documenting the measurement requirements for product or service acceptance? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('526', 'Are there sampling inspections made and according to which standard? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('527', 'Is there an SPC plan for processes and is it implemented? SPC', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('528', 'Is there a positive recall system for product that is released prior to completion of all required measurement and monitoring activities? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('529', 'Do records provide evidence that the product meets the defined requirements? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('530', 'Does the supplier perform First Article Inspections to include the inspection, verification and documentation of a representative item from the first production run of a new part? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('531', 'Does the documented procedure define the responsibility for review and the authority for dispositioning nonconforming product? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '2'),
('532', 'Is there a process for approving the personnel to make decisions regarding disposition of nonconforming product? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '2'),
('533', 'Is there a process of disposition of nonconforming material, with the participation of all involved parties (MRB board)? MRB', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('534', 'Is the customer approving nonconforming material dispositions (if contractually required)? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('535', 'Is nonconforming material identified by "Nonconforming Material" tag? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('536', 'Is nonconforming material passed to segregated storage (MRB)? MRB', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('537', 'Is there an up-to-date list of nonconforming material in the MRB segregation area? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
('538', 'Is there a mechanism for handling customer complaints? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '1'),
('539', 'Is there a mechanism for handling nonconforming product? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '1'),
('540', 'Is analysis Performed to identify root causes of problems/failures? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('541', 'Is there action initiated to prevent recurrence of problems/failures? /', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('542', 'Are problems/failures brought to management attention? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('543', 'Is there a process for flowing down the corrective action requirement to a supplier when it is determined that the supplier is responsible? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5'),
('544', 'Is there a process for actions to be taken when timely or effective corrective actions are not achieved? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '5');
